// src/Components/Item/Item.jsx
import React from 'react';
import './Item.css';

export const Item = ({ id, name, image, new_prices, old_prices }) => {
    return (
        <div className="item">
            <img src={image} alt={name} />
            <h2>{name}</h2>
            <p>New Price: {new_prices}</p>
            <p>Old Price: {old_prices}</p>
        </div>
    );
}
